SELECT matches.match_id, matches.radiant_win, matches.start_time, matches.game_mode, matches.dire_team_id, matches.radiant_team_id, matches.leagueid, matches.version, matches.picks_bans FROM matches WHERE matches.match_id > %MINIMUM_ID% AND matches.start_time > %MINIMUM_TIME% AND matches.picks_bans IS NOT NULL ORDER BY matches.match_id ASC LIMIT 200 OFFSET REP_OFFSET
